import React, { Component } from "react";

class Head extends Component {
  render() {
    return (
      <div className="bg-dark my-2 py-2 rounded text-center">
        <h1 className="text-white">Morocco world team 2022</h1>
      </div>
    );
  }
}

export default Head;
